import FavoriteIconDefault from '@mui/icons-material/FavoriteBorderOutlined'
import FavoriteIcon from '@mui/icons-material/FavoriteOutlined'
import WishlistIconDefault from '@mui/icons-material/BookmarkBorderOutlined'
import WishlistIcon from '@mui/icons-material/BookmarkOutlined'
import { pink } from '@mui/material/colors';
import { Box } from '@mui/material'
import { useState } from 'react'

function WishlistBookCard() {
    const [isFavorite, setIsFavorite] = useState(false)
    const [isWishlist, setIsWishlist] = useState(false)

    return (
        <Box sx={{
            display: 'flex'
        }}>
            <Box>
                {isWishlist ? <WishlistIcon sx={{ color: pink[500] }} /> : <WishlistIconDefault onClick={() => setIsWishlist(true)} /> }
            </Box>
            <Box>
                {isFavorite ? <FavoriteIcon sx={{ color: pink[500] }} /> : <FavoriteIconDefault onClick={() => setIsFavorite(true)} /> }
            </Box>
        </Box>
    )
    
} 

export default WishlistBookCard
